import React from 'react';

const EventLog = React.memo(({ logs }) => (
    <div className="bg-gray-800 rounded-md p-3 overflow-y-auto h-[75vh] flex-grow">
        {logs.map(log => (
            <div key={log.id} className={`log-item p-2 mb-1 rounded-md text-sm ${log.isAlert ? 'person' : 'bg-gray-700'}`}>
                <strong>[{log.timestamp} / 채널 {log.channelId >= 98 ? 'TEST' : log.channelId}]</strong> {log.message}
            </div>
        ))}
    </div>
));
export default EventLog;
